    backgroundSize: "100%",
    filter: "blur(3px)"
}
export default class Home extends Component {
    render() {
        return (
            <div className = "container" style={styles}>
                <div className = "home_text" style={{filter: "blur(0px)"}}>
                    Cacao & Beyond
                </div>
            </div>
        );
    }
}
